import * as React from "react";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Box,
  Button,
} from "@mui/material";
import AddIcon from "@mui/icons-material/Add";
import ClientsTableRow from "./ClientsTableRow";

function createData(name, status, isEnrolled, date, contact) {
  return { name, status, isEnrolled, date, contact };
}

const rows = [
  createData(
    "John Max",
    "Information Session",
    "No",
    "2023-01-02",
    "john.max@yahoo.com"
  ),
  createData(
    "Lily Mon",
    "Application Approved",
    "Yes",
    "2023-02-03",
    "301-233-1234"
  ),
];

const ClientsTableAddButton = {
  marginBottom: 3,
};

export default function ClientsTable() {
  return (
    <Box>
      <Box sx={{ display: "flex", justifyContent: "flex-end" }}>
        <Button variant="contained" sx={ClientsTableAddButton}>
          <AddIcon />
          Add
        </Button>
      </Box>
      <TableContainer component={Paper}>
        <Table
          sx={{ minWidth: 650, textAlign: "center" }}
          aria-label="simple table"
        >
          <TableHead>
            <TableRow>
              <TableCell>Name</TableCell>
              <TableCell>Status</TableCell>
              <TableCell>Is Enrolled?</TableCell>
              <TableCell>Latest Updated Date</TableCell>
              <TableCell>Contact</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <ClientsTableRow client={row} />
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
}
